import React from 'react';
import { Navigation } from "./routes";

import { ClienteLayout } from "./layouts"

export default function App() {
  return (
    <ClienteLayout className='app'>
        <Navigation>
          <h1 className='app__title'>Hola React!</h1>
        </Navigation>
    </ClienteLayout>
  );
}
